import React from "react";
import { Button } from "../../styles";
import { FooterContainer, FooterSubscription, FooterSubText, FooterSubHeading, Form, FormInput, FooterLinksContainer, FooterLinksWrapper, FooterLinkItems, FooterLinkTitle, FooterLink, SocialMedia, SocialMediaWrap, SocialLogo, WebsiteRights, SocialIcons, SocialIconLink } from "./Footer.elements";

function Footer() {
    return (
        <FooterContainer>
            <FooterSubscription>
                <FooterSubHeading>
                    Join our exclusive membership to receive the latest news and trends
                </FooterSubHeading>
                <FooterSubText>You can unsubscribe at any time.</FooterSubText>
                <Form>
                    <FormInput name="email" type="email" placeholder="Your Email"/>
                    <Button fontBig>Subscribe</Button>
                </Form>
            </FooterSubscription>

            <FooterLinksContainer>
                <FooterLink to='/policy'>Privacy Policy</FooterLink>
                <FooterLink to='/terms'>Terms of Service</FooterLink>
                <FooterLink to='/contact'>Contact</FooterLink>
                <WebsiteRights>Â© DailyCode 2022</WebsiteRights>
            </FooterLinksContainer>
        </FooterContainer>
    );
}

export default Footer;
